import React from 'react';
import {Menu} from 'antd';
import 'antd/dist/antd.css';
import {sidebar} from '../../menu.js';

const SubMenu = Menu.SubMenu;


export class Home extends React.Component{

    constructor(props){
        super(props);

        console.log(sidebar);
    }

    render(){
        return(
            <div>
               <Menu
               style={{width:'200px'}}
                mode="inline"
               >
                {sidebar.map((side)=>{
                  if(side.child==null){
                    return(
                        <Menu.Item key = {side.key}>{side.value}</Menu.Item>
                    )
                  }else{
                      let childmenu=side.child;
                      return(
                        <SubMenu key = {side.key}>
                     {
                    childmenu.map((child)=>{
                        return(
                        <Menu.Item key={child.key}>{side.value}</Menu.Item>
                      )
                  })
                   } 
                        </SubMenu>
                      )


                  }

                })}
               </Menu>
            </div>
        )
    }
}
